import './Expenses.css'

import ExpenseItem from './ExpenseItem'

export default function Expenses(props) {
	console.log(props.expenses)
	return (
		<div className="expenses">
			{props.expenses.map(ex => {
				return <ExpenseItem
					title={ex.title}
					date={ex.date}
					amount={ex.amount}
				></ExpenseItem>
			}
			)}
		</div>
	)
}
